import './App.css';
import Navbar from './Components/Navbar';
import News from './Components/News';
import { BrowserRouter,Route,createBrowserRouter,Routes,RouterProvider } from 'react-router-dom';


import React, { Component } from 'react'


export default class App extends Component {

  render() {
    return (
      <div>
        <BrowserRouter>
        <Navbar/>
        <Routes>
          <Route path='/' element={<News pageSize={5} country="us" category="general"/>}></Route>
          <Route path='/business' element={<News pageSize={5} country="us" category="business"/>}></Route>
          <Route path='/entertainment' element={<News pageSize={5} country="us" category="entertainment"/>}></Route>
          <Route path='/health' element={<News pageSize={5} country="us" category="health"/>}></Route>
          <Route path='/sports' element={<News pageSize={5} country="us" category="sports"/>}></Route>
          <Route path='/technology' element={<News pageSize={5} country="us" category="technology"/>}></Route>
          <Route path='/science' element={<News pageSize={5} country="us" category="science"/>}></Route>



        </Routes>
        </BrowserRouter>
      </div>
    )
  }
}
